import {useState,useEffect} from 'react'
import 'bootstrap/dist/css/bootstrap.css';
import logo from './acexa-white.png'; // Import the image
import './contact.css'
const Contact = () => {
    const [username,setUsername]=useState('')
    const [mailId,setMailId]=useState('')
    const [subject,setSubject]=useState('')
    const [message,setMessage]=useState('')
  return (
    <div className='container'>
      <nav className="top-nav navbar navbar-expand-lg navbar-light bg-light">
        <img src={logo} alt="Logo" className="navbar-brand logo" />
        <a className="navbar-brand" href="#">h1</a>
        <a className="navbar-brand" href="#">h2</a>
        <a className="navbar-brand" href="#">h3</a>
      </nav>
      <div className="form">
        <input type="text" name="username" placeholder='Your Name'/>
        <input type="text" name="mailId" placeholder='Your Mail'/>
        <input type="text" name="subject" placeholder='Subject'/>
        <textarea name="message" id="" cols="30" rows="5"/>
      </div>
    </div>
  );
}

export default Contact;
